INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES (0, "", 1070501040, 107011, 0, 1, "ふむ、よい趣向ですね。\n敬うべき相手を忘れず、恩を忘れず、\n健勝を祝う宴を開く……\n礼節を弁えた人間は好きですよ。", 1, 1070501, 11, 4);
